INSERT INTO `respuestas` VALUES (1,'Entidad pública dependiente del Tribunal Electoral Departamental responsable de llevar adelante la ejecucion de Procesos Electorales.',0,1,NULL,NULL,'2020-01-12 17:30:30','2020-01-12 09:36:15'),(2,'sdf',0,1,'2020-01-12 17:32:18',NULL,'2020-01-12 17:32:15','2020-01-12 17:32:18'),(3,'Entidad pública dependiente del Tribunal Supremo Electoral responsable del registro, custodia y administración de los datos de las personas naturales registradas en el registro civil y electoral.',1,1,NULL,NULL,'2020-01-12 09:35:19','2020-01-12 09:36:15'),(4,'Entidad pública dependiente del Tribunal Electoral Departamental responsable del registro, custodia y administración de los datos de las personas naturales registradas en el registro civil y electoral.',0,1,NULL,NULL,'2020-01-12 09:35:29','2020-01-12 09:36:15'),(5,'Es la o el servidor público, personal designado o contratado por el Tribunal Electoral Departamental, que cumplen funciones de apoyo logístico, operativo y dan fe de los actos electorales.',0,2,NULL,NULL,'2020-01-12 09:37:03','2020-01-12 09:37:24'),(6,'Es la o el servidor público, personal designado o contratado por el Tribunal Electoral Departamental, para cumplir las funciones de apoyo operativo, para la incorporación de ciudadanos al Sistema de Registro Biométrico.',0,2,NULL,NULL,'2020-01-12 09:37:11','2020-01-12 09:37:24'),(7,'Es la o el servidor público, personal designado o contratado por el Tribunal Supremo Electoral, para cumplir las funciones de apoyo operativo, responsable de la captura de la información biográfica y biométrica de las ciudadanas y ciudadanos, para suincorporación al Sistema de Registro Biométrico.',1,2,NULL,NULL,'2020-01-12 09:37:19','2020-01-12 09:37:24'),(8,'Proceso a través del cual se identifican los registros de las ciudadanas y los ciudadanos que pierden temporalmente el ejercicio de sus derechos políticos, a través de una sentencia ejecutoriada o resolución ejecutoriada emitida por autoridad competente.',0,3,NULL,NULL,'2020-01-12 09:38:04','2020-01-12 09:38:14'),(9,'Proceso técnico a través del cual se identifican los registros que tienen alguna causal legal o técnica de inhabilitación y se modifica el estado del registro en el Padrón Electoral, de tal forma de marcar estos registros para que no figuren en la lista de habilitadas y habilitados para votar.',1,3,NULL,NULL,'2020-01-12 09:38:12','2020-01-12 09:38:14'),(10,'Proceso a través del cual se depura del Padrón Electoral el registro de personas fallecidas., de tal forma de marcar estos registros para que no figuren en la lista de habilitadas y habilitados para votar.',0,3,NULL,NULL,'2020-01-12 09:38:29','2020-01-12 09:38:29'),(11,'Las Direcciones Departamentales y Direcciones Regionales del SERECI procederán a actualizar el Padrón Electoral a través de las Notarias y los Notarios Operadores de forma permanente y en procesos electorales, referéndum y revocatorias de mandato.',1,4,NULL,NULL,'2020-01-12 09:39:18','2020-01-12 09:39:18'),(12,'Los Tribunales Electorales Departamentales procederán a actualizar el Padrón Electoral a través de las Notarias y los Notarios Operadores de forma permanente y en procesos electorales, referéndum y revocatorias de mandato.',0,4,NULL,NULL,'2020-01-12 09:39:27','2020-01-12 09:39:27'),(13,'Es el lugar donde la persona tiene establecido el asiento principal de su residencia y de sus negocios',0,5,NULL,NULL,'2020-01-12 09:40:40','2020-01-12 09:41:00'),(14,'Es el lugar definido por la ciudadana o el ciudadano al momento de su empadronamiento, para ejercer sus derechos y cumplir sus obligaciones políticas.',1,5,NULL,NULL,'2020-01-12 09:40:56','2020-01-12 09:41:00'),(15,'Es donde la ley presume que la persona reside permanentemente para el ejercicio de sus derechos y en cumplimiento de sus obligaciones.',0,5,NULL,NULL,'2020-01-12 09:41:11','2020-01-12 09:41:11'),(16,'Para ciudadanas y ciudadanos bolivianos presentar cédula de identidad vigente, Libreta de Servicio Militar o RUN; en territorio nacional y el pasaporte o cedula de identidad vigente en el exterior.',0,6,NULL,NULL,'2020-01-12 09:41:54','2020-01-12 09:42:03'),(17,'Para ciudadanas y ciudadanos bolivianos presentar cédula de identidad vigente en territorio nacional y el pasaporte o cedula de identidad vigente en el exterior.',1,6,NULL,NULL,'2020-01-12 09:42:01','2020-01-12 09:42:03'),(18,'El formulario de empadronamiento deberá ser impreso',0,6,'2020-01-12 09:42:38',NULL,'2020-01-12 09:42:24','2020-01-12 09:42:38'),(19,'En caso de empadronamiento en territorio nacional, el formulario deberá ser impreso en tres ejemplares, que serán firmados por el empadronado y la o el Notario Electoral Operador. Un ejemplar será entregado a la ciudadana o el ciudadano y los otros dos a la Dirección Departamental y Nacional del Servicio de Registro Cívico.',1,7,NULL,NULL,'2020-01-12 09:43:07','2020-01-12 09:43:07'),(20,'En caso de empadronamiento en territorio nacional, el formulario deberá ser impreso en 4 ejemplares, que serán firmados por el empadronado y la o el Notario Electoral Operador. Un ejemplar será entregado a la ciudadana o el ciudadano y los otros tres al Tribunal Elecrtoral Departamental, Dirección Departamental y Nacional del Servicio de Registro Cívico.',0,7,NULL,NULL,'2020-01-12 09:43:14','2020-01-12 09:43:14'),(21,'Son equipos electrónicos que gestionan de manera automática la asistencia de usuarios en un recinto, la asistencia de los trabajadores en una empresa y/o edificio de oficina.',0,8,NULL,NULL,'2020-01-12 09:43:47','2020-01-12 09:43:56'),(22,'Es el conjunto de herramientas y bases de datos que permiten el registro, la transmisión, almacenamiento y procesamiento de datos registrados. Contiene las inscripciones biométricas de todas las personas empadronadas.',1,8,NULL,NULL,'2020-01-12 09:43:55','2020-01-12 09:43:56'),(23,'Es el registro que debe ser inscrito en una Oficialía de Registro Civil previo trámite administrativo seguido ante la Dirección Departamental de Registro Civil, conforme establece el presente Reglamento.',0,9,NULL,NULL,'2020-01-12 09:44:24','2020-01-12 09:44:46'),(24,'Es el acto mediante el cual las ciudadanas o los ciudadanos se inscriben en el Sistema de Registro Biométrico en cualquier Oficialía de Registro Civil. Sólo en caso de incapacidad de obrar del mayor de 18 años la solicitud podrá ser presentada por sus Padres o su Tutor.',0,9,NULL,NULL,'2020-01-12 09:44:32','2020-01-12 09:44:46'),(25,'Es el acto mediante el cual las ciudadanas o los ciudadanos se inscriben en el Sistema de Registro Biométrico, bajo la modalidad de empadronamiento permanente o empadronamiento masivo.',1,9,NULL,NULL,'2020-01-12 09:44:40','2020-01-12 09:44:46'),(26,'Proceso a través del cual se depura del Padrón Electoral el registro de personas fallecidas., de tal forma de marcar estos registros para que no figuren en la lista de habilitadas y habilitados para votar.',1,10,NULL,NULL,'2020-01-12 09:46:04','2020-01-12 09:46:04'),(27,'Proceso a través del cual se identifican los registros de las ciudadanas y los ciudadanos que pierden temporalmente el ejercicio de sus derechos políticos, a través de una sentencia ejecutoriada o resolución ejecutoriada emitida por autoridad competente.',0,10,NULL,NULL,'2020-01-12 09:46:18','2020-01-12 09:46:18'),(28,'Proceso técnico a través del cual se identifican los registros que tienen alguna causal legal o técnica de inhabilitación y se modifica el estado del registro en el Padrón Electoral, de tal forma de marcar estos registros para que no figuren en la lista de habilitadas y habilitados para votar.',0,10,NULL,NULL,'2020-01-12 09:46:25','2020-01-12 09:46:25'),(29,'Departamento, provincia, municipio, localidad, , la zona, el nombre de avenida o calle y el número de vivienda.',0,11,NULL,NULL,'2020-01-12 09:46:51','2020-01-12 09:47:00'),(30,'El país, el departamento, provincia, municipio, localidad, el código postal (aplicable para algunos países del exterior), la zona, el nombre de avenida o calle y el número de vivienda.',1,11,NULL,NULL,'2020-01-12 09:46:58','2020-01-12 09:47:00'),(31,'Provincia, municipio, localidad, el código postal (aplicable para algunos países del exterior), la zona, el nombre de avenida o calle y el número de vivienda.',0,11,NULL,NULL,'2020-01-12 09:47:08','2020-01-12 09:47:08'),(32,'Para las extranjeras o extranjeros con residencia de un año en el país o con residencia indefinida, deberán presentar cédula de identidad de extranjero y podrán participar en todos los procesos electorales.',0,12,NULL,NULL,'2020-01-12 09:47:45','2020-01-12 09:48:03'),(33,'Las extranjeras o extranjeros deberán presentar cédula de identidad de su pais de Origen para el registro.',0,12,NULL,NULL,'2020-01-12 09:47:54','2020-01-12 09:48:03'),(34,'Para las extranjeras o extranjeros con residencia de dos o más años en el país o con residencia indefinida, deberán presentar cédula de identidad de extranjero y sólo podrán participar en procesos electorales municipales.',1,12,NULL,NULL,'2020-01-12 09:48:01','2020-01-12 09:48:03'),(35,'Empadronamiento Permanente y Empadronamiento Masivo',1,13,NULL,NULL,'2020-01-12 09:48:37','2020-01-12 09:48:37'),(36,'Empadronamiento en Oficialias de Registro Civil , Empadronamiento en Colegios',0,13,NULL,NULL,'2020-01-12 09:48:45','2020-01-12 09:48:45'),(37,'Empadronamiento en SERECI y Empadronamiento en Tribunales Departamentales Electorales.',0,13,NULL,NULL,'2020-01-12 09:48:58','2020-01-12 09:48:58'),(38,'Las bolivianas y los bolivianos que cumplan 18 años antes del 31 de diciembre de cada año.',0,14,NULL,NULL,'2020-01-12 09:49:37','2020-01-12 09:49:45'),(39,'Las bolivianas y los bolivianos que tengan 18 años cumplidos al día de su registro.',1,14,NULL,NULL,'2020-01-12 09:49:43','2020-01-12 09:49:45'),(40,'Ciudadanos nacionales y extranjeros, con el solo requisito de haber cumplido 18 años.',0,14,NULL,NULL,'2020-01-12 09:49:54','2020-01-12 09:49:54'),(41,'Tener relación de parentesco hasta el tercer grado de consanguinidad y afinidad, según el Código Civil, con autoridades electorales o servidores públicos del Tribunal Supremo Electoral o Tribunal Electoral Departamental respectivo.',0,15,NULL,NULL,'2020-01-12 09:50:32','2020-01-12 09:50:41'),(42,'Tener relación de parentesco hasta el cuarto grado de consanguinidad y segundo de afinidad hasta el segundo grado, según el Código Civil, con autoridades electorales o servidores públicos del Tribunal Supremo Electoral o Tribunal Electoral Departamental respectivo.',1,15,NULL,NULL,'2020-01-12 09:50:39','2020-01-12 09:50:41'),(43,'Tener relación de parentesco hasta el segundo grado de consanguinidad y tercero de afinidad hasta el segundo grado, según el Código Civil, con autoridades electorales o servidores públicos del Tribunal Supremo Electoral o Tribunal Electoral Departamental respectivo.',0,15,NULL,NULL,'2020-01-12 09:50:47','2020-01-12 09:50:47'),(44,'A las bolivianas y bolivianos que cumplan 18 años hasta el día de la elección, referendo o revocatoria de manadato, siempre y cuando dicha inscripción se efectúe dentro el plazo para el empadronamiento biométrico establecido en el calendario electoral, tanto el pais como en el exterior y a las ciudadanas y los ciudadanos extrajeros que tengan residencia regular en Bolivia; solo para sufragar en elecciones municipales.',1,16,NULL,NULL,'2020-01-12 09:52:12','2020-01-12 09:52:12'),(45,'A todas las bolivianas y bolivianos hasta el día de la elección, referendo o revocatoria de manadato, siempre y cuando dicha inscripción se efectúe dentro el plazo para el empadronamiento biometrico establecido enel calendario electoral tanto el país como en el exterior y a las ciudadanas y los ciudadanos que tengan residencia regular en el pais; solo para sufragar en elecciones municipales.',0,16,NULL,NULL,'2020-01-12 09:52:42','2020-01-12 09:52:42'),(46,'Es el registro de los datos personales de un ciudadano',0,17,NULL,NULL,'2020-01-12 09:53:25','2020-01-12 09:53:35'),(47,'Información referida a huellas dactilares y fotografía facial',1,17,NULL,NULL,'2020-01-12 09:53:33','2020-01-12 09:53:35');
